      commentary: {
        numLines: 3,
        text: {
          textDirection: "FIRST_STRONG",
          text: 'The other day I saw this picture and I noticed this curious thing ... the weights in the machine  are worn out according to what is a normal distribution! (what a NERD ..) \nBut what I noticed after a moment is that the 95kg weight is much less worn, in favor of a much more worn 100kg than it should be ... \nThe number 100 has always had the meaning of "maximum score" or "finish line", and the fact that it is much more used against poor 95, is a clear example of how the psychology of "I got to 100!" is a stimulating incentive to give more than (we think) our real abilities are (in this case the almost unused 95).\n\nAnyway, I’m not even close to 100kg :)\n\n#psychology #motivation #100',
        },
      },
